    Failure {
        error: error::Error,
        effect: ExecutionEffect,
        transfers: Vec<TransferAddr>,
        cost: Gas,
    },
    Success {
        effect: ExecutionEffect,
        transfers: Vec<TransferAddr>,
        cost: Gas,
    },
}

pub enum ForcedTransferResult {
    InsufficientPayment,
    GasConversionOverflow,
    PaymentFailure,
}

pub enum ExecutionResultBuilderError {
    MissingPaymentExecutionResult,
    MissingSessionExecutionResult,
    MissingFinalizeExecutionResult,
}

pub enum GenesisResult {
    RootNotFound,
    KeyNotFound(Key),
    TypeMismatch(TypeMismatch),
    Serialization(bytesrepr::Error),
    Success {
        post_state_hash: Blake2bHash,
        effect: ExecutionEffect,
    },
}

pub enum GenesisAccount {
    System,
    Account {
        public_key: PublicKey,
        balance: Motes,
        validator: Option<GenesisValidator>,
    },
    Delegator {
        validator_public_key: PublicKey,
        delegator_public_key: PublicKey,
        balance: Motes,
        delegated_amount: Motes,
    },
}

pub enum GenesisError {
    UnableToCreateRuntime,
    InvalidMintKey,
    MissingMintContract,
    UnexpectedStoredValue,
    MissingPublicKey,
    ExecutionError(execution::Error),
    MintError(mint::Error),
    CLValue(String),
    OrphanedDelegator {
        validator_public_key: PublicKey,
        delegator_public_key: PublicKey,
    },
    DuplicatedDelegatorEntry {
        validator_public_key: PublicKey,
        delegator_public_key: PublicKey,
    },
    InvalidDelegationRate {
        public_key: PublicKey,
        delegation_rate: DelegationRate,
    },
    InvalidBondAmount {
        public_key: PublicKey,
    },
    InvalidDelegatedAmount {
        public_key: PublicKey,
    },
}

pub enum QueryResult {
    RootNotFound,
    ValueNotFound(String),
    CircularReference(String),
    DepthLimit {
        depth: u64,
    },
    Success {
        value: Box<StoredValue>,
        proofs: Vec<TrieMerkleProof<Key, StoredValue>>,
    },
}

pub enum GetBidsResult {
    RootNotFound,
    Success {
        bids: Bids,
    },
}

pub enum TransferTargetMode {
    Unknown,
    PurseExists(URef),
    CreateAccount(AccountHash),
}

pub enum UpgradeResult {
    RootNotFound,
    KeyNotFound(Key),
    TypeMismatch(TypeMismatch),
    Serialization(bytesrepr::Error),
    Success {
        post_state_hash: Blake2bHash,
        effect: ExecutionEffect,
    },
}

pub enum TrackingCopyQueryResult {
    Success {
        value: StoredValue,
        proofs: Vec<TrieMerkleProof<Key, StoredValue>>,
    },
    ValueNotFound(String),
    CircularReference(String),
    DepthLimit {
        depth: u64,
    },
}

pub enum AddResult {
    Success,
    KeyNotFound(Key),
    TypeMismatch(TypeMismatch),
    Serialization(bytesrepr::Error),
}

