pub enum PreprocessingError {
    Deserialize(String),
    OperationForbiddenByGasRules,
    StackLimiter,
    MissingMemorySection,
}

pub enum Error {
    Lmdb(lmdb_external::Error),
    BytesRepr(bytesrepr::Error),
    Poison,
}

pub enum CommitResult {
    RootNotFound,
    Success {
        state_root: Blake2bHash,
    },
    KeyNotFound(Key),
    TypeMismatch(TypeMismatch),
    Serialization(bytesrepr::Error),
}

pub enum TrieMerkleProofStep {
    Node {
        hole_index: u8,
        indexed_pointers_with_hole: Vec<(u8, Pointer)>,
    },
    Extension {
        affix: Bytes,
    },
}

pub enum Trie<K, V> {
    Leaf {
        key: K,
        value: V,
    },
    Node {
        pointer_block: Box<PointerBlock>,
    },
    Extension {
        affix: Bytes,
        pointer: Pointer,
    },
}
